import React from "react";
import Card_Galeria from "./Card_Galeria";
const Galeria = () => {
	return (
		<div className="container">
			<div className="row">
				<Card_Galeria />
				<Card_Galeria />
				<Card_Galeria />
				<Card_Galeria />
				<Card_Galeria />
				<Card_Galeria />
			</div>
		</div>
	);
};

export default Galeria;
